import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../../App.css';
import axios from 'axios';
class Appointment extends React.Component {
    constructor(props) {
        super(props)
    
        this.state = {
            CarName:'',
            Model:'',
            washerName:'',
            washpackageId:'',
            PrefferedDate:'',
            contactNo:'',
        }
    }
   
      handlecarnameChange = (e) => {
        this.setState({
         CarName : e.target.value
        })
      }
      handlemodelChange = (e) => {
        this.setState({
          Model : e.target.value
        })
      } 
      handlenameChange = (e) => {
        this.setState({
          washerName : e.target.value
        })
      }
      changewasherHandler = (e) => {
        this.setState({
            washpackageId : e.target.value
        })
      }
      changedateHandler = (e) => {
        this.setState({
            PrefferedDate : e.target.value
        })
      }
      changecontactHandler = (e) => {
        this.setState({
            contactNo : e.target.value
        })
      }

      handleSubmit= (event) =>{
        alert(`${this.state.CarName} ${this.state.Model} ${this.state.washerName}`)
        const data = {
              carName:this.state.CarName,
              model:this.state.Model,
              washerName:this.state.washerName,
              washpackageId:this.state.washpackageId,
              prefferedDate:this.state.PrefferedDate,
              contactNo:this.state.contactNo,
            }
            console.log("data",data)
           axios({
             method: 'post',
             url:"http://localhost:8085/order/addorder",
             data
           }).then((resp) => console.log("resp",resp))
           .catch(() => {})
           navigate('/payment')
        event.preventDefault()
      }


    render(){
        const  navigation  = useNavigation();
        return(
          <>
        <form className='login' onSubmit={this.handleSubmit}>
         <div>
           <h1>Appointment Details</h1>
                        <label> CarName</label>
                        <input  type='text'  onChange={this.handlecarnameChange}/>
                    </div>
                    <div>
                        <label>Model</label>
                        <input  type='text'  onChange={this.handlemodelChange}/>
                    </div>
                    <div>
                        <label>Name</label>
                        <input  type='text' onChange={this.handlenameChange}/>
                    </div>
                    <div style={{marginBottom:"20px"}}>
                    <label>washpack</label>
                        <select className="contactDetails" name="washpackId"  onChange={this.changewasherHandler} >
                            <option className="opt1">Service Types</option>
                            <option>999</option>
                            <option>1499</option>
                            <option>1999</option>
                        </select>
                    </div>
                    <div >
                        <label>Date</label>
                        <input type="date" name="Date"  onChange={this.changedateHandler} />
                    </div>
                    <div >
                        <label>Contact</label>
                        <input type="text"  onChange={this.changecontactHandler} />
                    </div>

                    <div>
                        <button className='log' value="submit">submit</button>
                    </div>
                </form>
          </>
        )
    }
    }
  export default Appointment;
